hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">Perdagangan dan daur ulang</h3>\n<!-- /wp:heading --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Upgrade ke teknologi terbaru sambil tetap peduli lingkungan dengan program tukar tambah dan daur ulang kami. Tukar tambah perangkat lama Anda untuk mendapatkan kredit untuk pembelian baru atau daur ulang dengan cara yang bertanggung jawab.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"8px\"} -->\n<div style=\"height:8px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:buttons {\"style\":{\"spacing\":{\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}}} -->\n<div class=\"wp-block-buttons\" style=\"margin-top:0;margin-bottom:0\"><!-- wp:button --><div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Mulai</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":222,\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/06/772d1d20f57861f0aa71dccda165b03e.jpeg\" alt=\"\" class=\"wp-image-222\" style=\"aspect-ratio:4/3;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">Garansi diperpanjang</h3>\n<!-- /wp:heading --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Lindungi investas