ustom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"left\":\"var:preset|spacing|50\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Komitmen terhadap keberlanjutan</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">Sumber etis adalah yang terdepan dalam segala yang kami lakukan. Kami bangga mendukung mode berkelanjutan dengan memprioritaskan penggunaan bahan organik dan daur ulang dalam pakaian dan aksesori kami. Dengan mendukung inisiatif perdagangan yang adil dan menjaga rantai pasokan yang transparan, kami memastikan bahwa setiap produk menjunjung komitmen kami terhadap praktik etis.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Quality and Craftsmanship\" in Indonesian is \"Kualitas dan Kerajinan\".</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">Kami berdedikasi untuk menciptakan karya-karya abadi yang tahan terhadap ujian waktu. Setiap pakaian dan aksesori dalam koleksi kami adalah bukti komitmen kami yang tak tergoyahkan terhadap kualitas dan kerajinan. Kami bangga hanya menggunakan bahan-bahan terbaik dan menerapkan perhatian yang teliti terhadap detail di setiap langkah proses pembuatan.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:78:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/two-column-text-sections/\";s:13:\"modified_date\";s:19:\"2024-07-04 14:16:22\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:28;a:18:{s:2:\"ID\";i:313;s:7:\"site_id\";i:231214916;s:5:\"title\";s:42:\"Konten dengan grid gambar di sebelah kanan\";s:4:\"name\";s:36:\"content-with-grid-of-images-on-right\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:5483:\"<!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\",\"bottom\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\",\"left\":\"var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\