pe\":\"constrained\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-group alignfull\" style=\"margin-top:0;margin-bottom:0;padding-top:calc( 0.5 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)));padding-right:var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal));padding-bottom:calc( 0.5 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)));padding-left:var(--wp--style--root--padding-left, var(--wp--custom--gap--horizontal))\"><!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"45%\",\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|20\"}}} -->\n<div class=\"wp-block-column\" style=\"flex-basis:45%\"><!-- wp:heading {\"fontSize\":\"small\"} -->\n<h2 class=\"wp-block-heading has-small-font-size\">Buat sesuatu</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Temukan semua kemungkinan</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"55%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:55%\"><!-- wp:spacer {\"height\":\"var:preset|spacing|20\"} -->\n<div style=\"height:var(--wp--preset--spacing--20)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Kami percaya bahwa rumahmu harus mencerminkan gaya dan kepribadian unikmu. Koleksi pilihan kami dari kebutuhan rumah dan barang dekorasi dirancang untuk membantumu menciptakan ruang yang benar-benar Suka kamu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Desainer ahli kami akan bekerja sama dengan Anda untuk mewujudkan visi Anda. Dari pemilihan furnitur hingga skema warna, kami akan memberikan saran dan panduan profesional di setiap langkah untuk membantu Anda mencapai keseimbangan sempurna antara kenyamanan, fungsionalitas, dan daya tarik estetika.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:84:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/heading-left-and-content-right/\";s:13:\"modified_date\";s:19:\"2024-07-01 15:41:54\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:44;a:18:{s:2:\"ID\";i:275;s:7:\"site_id\";i:231214916;s:5:\"title\";s:31:\"Konten kiri dengan gambar kanan\";s:4:\"name\";s:29:\"content-left-with-image-right\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:3496:\"<!-- wp:group {\"metadata\":{\"name\":\"About\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\",\"bottom\":\"ca